import React, { useState, useEffect } from "react"

const EventsTimeline = (props) => {
    const [last5Days, setLast5Days] = useState([])

    useEffect(() => {
        setLast5Days(props.tests.reverse().slice(0,5))
    }, [props])

    return (
        <div>
            
            <div className="timeline-main">
                <ul className="stepper stepper-vertical timeline timeline-simple pl-0">
                {last5Days.map((daysData, index) => (
                    <li key={index}>
                        <a href="#!">
                            <span className="circle blue"></span>
                        </a>
                        <div className="step-content mr-xl-3 p-4 hoverable">
                            {/* <h4 className="font-weight-bold">Duis aute irure dolor</h4> */}
                <p className="text-muted mt-3"><i className="far fa-clock" aria-hidden="true"></i>{new Date(daysData.updatedon).toUTCString()}</p>
                            <p className="mb-0">
                                Recovery
                                mortality
                                avg growth rate
                                tests per million
                                    </p>
                        </div>
                    </li>
                ))}
                </ul>
            </div>
        </div>
    )
}

export default EventsTimeline
